//           document.getElementById("videoTag").load();
//         });
//       });
//     });
//   }

  render() {
    return (
      <div>
        <MDBView width= '100%' height='{600}'>
          <video id="videoTag" autoPlay loop muted>
            <source src={BackGroundVideo} type="video/mp4" />
          </video>
        </MDBView>
        <main>
          <MDBContainer className="text-center my-5">
            <VerticalTimeline>
              <VerticalTimelineElement
                className="vertical-timeline-element--work"
                contentStyle={{
                  height: 200,
                  backgroundImage: `url(${Desert})`,
                  backgroundRepeat: "no-repeat",
                  backgroundOrigin: "content-box",
                  backgroundPosition: "center",
                  backgroundSize: 500,
                  textAlign:'center',
                  fontWeight:'bold',
                  color:'white',
                  letterSpacing:'2px',
                  textShadow: '0.5px 0.5px black'
                }}
                contentArrowStyle={{}}
                iconStyle={{
                  backgroundImage: `url(${mountain})`,
                  backgroundRepeat: "no-repeat",
                  backgroundOrigin: "content-box",
                  backgroundPosition: "center",
                  backgroundSize: 40,
                }}
              >
                <h3  style = {{fontWeight:'500'}}  className="vertical-timeline-element-title">
                  20.11.2020
                </h3>
                <h4  style = {{fontWeight:'300'}} className="vertical-timeline-element-subtitle">
                 חרדים וערבים יחדיו
                </h4>
                <p>
                  מסע אל לב ליבה של התרבות החרדית והערבית יחדיו
                </p>
              </VerticalTimelineElement>
              <VerticalTimelineElement
                className="vertical-timeline-element--work"
                contentStyle={{
                  height: 300,
                  backgroundImage: `url(${Desert})`,
                  backgroundRepeat: "no-repeat",
                  backgroundOrigin: "content-box",
                  backgroundPosition: "center",
                  backgroundSize: 500,
                }}
                contentArrowStyle={{}}
                iconStyle={{
                  backgroundImage: `url(${mountain})`,
                  backgroundRepeat: "no-repeat",
                  backgroundOrigin: "content-box",
                  backgroundPosition: "center",
                  backgroundSize: 40,
                }}
              >
                <h3 className="vertical-timeline-element-title">
                  Art Director
                </h3>
                <h4 className="vertical-timeline-element-subtitle">
                  San Francisco, CA
                </h4>
                <p>
                  Creative Direction, User Experience, Visual Design, SEO,
                  Online Marketing
                </p>
              </VerticalTimelineElement>
              <VerticalTimelineElement
                className="vertical-timeline-element--work"
                contentStyle={{
                  height: 300,
                  backgroundImage: `url(${Desert})`,
                  backgroundRepeat: "no-repeat",
                  backgroundOrigin: "content-box",
                  backgroundPosition: "center",
                  backgroundSize: 500,
                }}
                contentArrowStyle={{}}
                iconStyle={{
                  backgroundImage: `url(${mountain})`,
                  backgroundRepeat: "no-repeat",
                  backgroundOrigin: "content-box",
                  backgroundPosition: "center",
                  backgroundSize: 40,
                }}
              >
                <h3 className="vertical-timeline-element-title">
                  Web Designer
                </h3>
                <h4 className="vertical-timeline-element-subtitle">
                  Los Angeles, CA
                </h4>
                <p>User Experience, Visual Design</p>
              </VerticalTimelineElement>
              <VerticalTimelineElement
                className="vertical-timeline-element--work"
                contentStyle={{
                  height: 300,
                  backgroundImage: `url(${Desert})`,
                  backgroundRepeat: "no-repeat",
                  backgroundOrigin: "content-box",
                  backgroundPosition: "center",
                  backgroundSize: 500,
                }}
                contentArrowStyle={{}}
                date="20.12.2005"
                dateStyle = {{}}
                iconStyle={{
                  backgroundImage: `url(${mountain})`,
                  backgroundRepeat: "no-repeat",
                  backgroundOrigin: "content-box",
                  backgroundPosition: "center",
                  backgroundSize: 40,
                }}
              >
                <h3 className="vertical-timeline-element-title">
                  Web Designer
                </h3>
                <h4 className="vertical-timeline-element-subtitle">
                  San Francisco, CA
                </h4>
                <p>User Experience, Visual Design</p>
              </VerticalTimelineElement>
            </VerticalTimeline>
          </MDBContainer>
        </main>
        <FooterPage />
      </div>
    );
  }
}

export default main;
